      "content": "\u003cdiv class\u003d\"introduction img-head\"\u003e\r\n  \u003cdiv class\u003d\"header\"\u003e\r\n     \u003cimg src\u003d\"data:image/svg+xml;base64,\u003d\" alt\u003d\"\" /\u003e\r\n    \u003ch3\u003eQuality Prediction Application\u003c/h3\u003e\r\n  \u003c/div\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eOverview\u003c/h4\u003e\r\n    \u003cp\u003e\r\n      This app enables manufacturers and quality teams to analyze factors affecting product quality and predict the final quality score using trained machine learning models. It helps identify patterns across human error, material degradation, sensor failures, and demand fluctuations.\r\n    \u003c/p\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eInput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Quality-related datasets \u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Features affecting quality.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Range of Features\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Model name .\u003c/li\u003e\r\n    \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eOutput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Final quality prediction for each trained model.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Visualized analysis of quality factors across selected metrics.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Model training performance metrics and logs.\u003c/li\u003e\r\n    \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eKey Features\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Targeted Quality Improvement: Identify the exact factors that influence product quality.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Automated Model Training: Quickly build and evaluate models with minimal manual effort.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Error Source Diagnosis: Understand root causes across human, sensor, and material factors.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Data-Driven Decisions: Drive better operational choices and improve final product standards.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Scalable Analysis: Handle complexity with multiple datasets and dynamic filters.\u003c/li\u003e\r\n    \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\u003c/div\u003e\r\n",
